  input: TEXT,F3A,,"This amendment is in response to the Commission's letter dated
    January 19, 2007.  Contributions from John Blair, Dan Callaghan, and Stephen Moreland
    on September 30, 2006, and October 2, 2006, are duplicates.  The receipts for
    October 2, 2006, have been deleted from this amendment.  Contributions from John
    Blair, Pamela Blair, and Terry Sammons on May 4, 2006, were mistakenly reported
    as Primary Election contributions.  The July Quarterly 2006 report has been amended
    to reflect these corrections.  The Committee is currently undertaking an internal
    audit of their Pre-General and Post-General Reports.  Amendments will be filed
    with corrected Column B and beginning cash on hand figures once completed.  Purpose
    fields and addresses for Schedule B of the Committee's report have been updated.  Payments
    to credit card companies and reimbursements to individuals have been itemized
    to more clearly identify the original vendors for each payment.  Schedule C has
    been corrected to show all of the necessary loan information."
